:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  WILLIAMS, Marianne and DAVIES, Christopher Pearson
  IDAVIES, Marianne Caroline and BUSBY, William
  JBUSBY, Kathleen Mary and CANNING, Davis
  ICANNING, Walmsley and COX, Doreen Mary
  06> CANNING, Walmsley m on ** **, 1958 to Cox, Doreen Mary
  b 05.10.1907 d 17.04.1994
  b 29.05.1924
  Walmsley b. at Oakbourne Station, Waipukurau and d. at Kerikeri. Mary, d/o FH Cox and G M Roff.
  Walmsley was a farmer at "Oakbourne", Porangahau. He spent five years in the Royal Navy in WW2, mainly
  on minesweepers but also for a time on Malta convoys.
  07> CANNING, Robert Alexander m on 23.12.1939 to PATTISON, Fanny
  b 07.10.1911 d 06.10.1997
  b 12.08.1913
  Robert b. at Napier and m. at Waipawa. Fanny, d/o Charles Pattison and Dora Louise White, b. at
  Waipukurau. Charles Pattison had managed Oakbourne for the Whites and also for Robert's father, Davis
  for a short time around 1906. Dora White's family leased Oakbourne from 1885 to 1905.
  Robert was a farmer at Oakbourne, Porangahau, He was educated at Huntley School and Wanganui Collegiate
  School (1st rugby XV, 1929-30). He was a gunner in the 5th Field Artillery in WW2 (Reg No 60707). He
  was captured at Sidi Resegh and was a POW in Italy, Austria and Germany and was on the infamous
  Salzburg March during which many POWs died.
  01> CANNING, Davis Charles m on 07.03.1970 to HUNTER, Mary
  b 17.11.1946
  b 26.07.1948
  Davis b. at Waipawa and m. at Iona College, Havelock North. Mary, d/o Bruce Irving Hunter and Lois
  Tamblyn Anderson, b, at Dunedin. Address: "Oakbourne", RD 1, Porangahau, Hawkes Bay.
  Davis was educated at Hereworth School and Wanganui Collegiate School (1st hockey XI, 1963-64) and
  is now a farmer. He was a lay member of the Iona College Council (1987-94). Mary is a registered
  nurse.
  b1> CANNING, Nichola
  b 24.09.1972
  Nichola b. at Palmerston North.
  Nichola attended Iona College and is now a Law student at Canterbury University.
  02> CANNING, Davis Andrew
  b 10.01.1974
  Andrew b, at Waipukurau.
  Andrew was educated at Hereworth School and Wanganui Collegiate School (1st hockey XI, 1990).
  03> CANNING, Susannah Margaret
  b 09.02.1975
  Susannah b. at Waipukurau and educated at Iona College.
  > CANNING, Julian Margaret m on 01.12.1979 to MACKERSEY, David John
  (Julie)
  b 20.03.1949
  b 30.09.1953
  Julian b. at Waipukurau and m. at Porangahau. David, s/o John Charles Mackersey and Margaret Olive
  Sinclair, b. at Hastings. Address: 911a Harding Road, Hastings.
  David is a builder and managing director of Mackersey Construction. He and Julian are developing a
  new garden and are keen tennis players.
  01> MACKERSEY, Caroline
  b 07.06.1982
  Caroline b. at Hastings. She is a student at Woodford House, plays tennis and netball and is
  keenly interested in fashion.
